import { Search as SearchIcon } from '@mui/icons-material';
import { InputBase,Box,styled} from '@mui/material';
import { Component } from 'react';

const Search =() =>{

    return (

        <Component>
            <Box>
                <Box>
                    <SearchIcon/>
                </Box>
                <InputBase/>
            </Box>
        </Component>
    )
}

export default Search;
